import Expenses from "./components/Expenses";

function App() {
  const expenses = [
    {
      id: "e1",
      title: "Toilet Paper",
      amount: 94.12,
      date: new Date(2020, 7, 14),
    },
    {
      id: "e2",
      title: "New TV",
      amount: 799.49,
      date: new Date(2021, 2, 12),
    },
    {
      id: "e3",
      title: "Car Insurance",
      amount: 294.67,
      date: new Date(2021, 2, 28),
    },
    {
      id: "e4",
      title: "New Desk (Wooden)",
      amount: 450,
      date: new Date(2021, 5, 12),
    },
  ];

  return (
    //jsx 자바스크립트 xml(HTML)을 의미한다
    //props객체에서 접근하는 키는 내가 설정한 속성이름이여야한다.(ex: title,amount...)
    <div>
      <h2>Let's get started!</h2>
      <div className="expenses">
        <Expenses items={expenses}/>
      </div>
    </div>
  );
}

export default App;
